import React from "react";
import './index.css';

function Kanbas() {
  return (
    <div className="d-flex">
      <KanbasNavigation />
      <ul class="wd-kanbas-navigation">
    <li><a href="account/index.html"> <i class="fa-regular fa-circle-user wd-nav-item-icon white"></i><p>Account</p></a></li>
</ul>

    </div>
  );
}
export default Kanbas;
